pageContext.rootQuery:
query getPortfolio {
  prismic {
    allPortfolio_items {
      edges {
        node {
          title
          subtitle
          main_image
          main_imageSharp {
              childImageSharp {
                fluid(quality: 100, maxWidth: 960) {
                  ...GatsbyImageSharpFluid_withWebp
                }
              }
          }
          _meta {
            uid
            type
          }
        }
      }
    }
    allCategoriess(uid: "portfolio") {
      edges {
        node {
          title
          subtitle
          excerpt
        }
      }
    }
  }
}
